"use strict";(self.webpackChunkjava_note_vuepress2=self.webpackChunkjava_note_vuepress2||[]).push([[3955],{60450:(e,t,a)=>{a.r(t),a.d(t,{data:()=>n});const n={key:"v-3e567e30",path:"/maven/103-%E9%9D%9E%E7%88%B6%E5%AD%90%E5%85%B3%E7%B3%BB%E7%9A%84%E5%A4%9A%E6%A8%A1%E5%9D%97%E9%A1%B9%E7%9B%AE.html",title:"非父子关系的多模块项目",lang:"zh-CN",frontmatter:{},excerpt:"",headers:[],filePathRelative:"maven/103-非父子关系的多模块项目.md",git:{updatedTime:1629711344e3,contributors:[{name:"hemiao",email:"hemiao3000@126.com",commits:1}]}}},53797:(e,t,a)=>{a.r(t),a.d(t,{default:()=>r});const n=(0,a(66252).uE)('<h1 id="非父子关系的多模块项目" tabindex="-1"><a class="header-anchor" href="#非父子关系的多模块项目" aria-hidden="true">#</a> 非父子关系的多模块项目</h1><p>其实多模块项目可以不必是父子项目。</p><p>这种情况下：</p><ol><li><p>原来的父项目中仍有 <strong>&lt;modules&gt;</strong> 元素，用来囊括子项目。</p></li><li><p>原来的子项目中不再有 <strong>&lt;parent&gt;</strong> 元素。或者 <strong>&lt;parent&gt;</strong> 元素指向另外的项目，不再是原来的父项目。</p></li></ol><p>这样一来，这些项目和项目之间就『<strong>不再是父子</strong>』项目关系，因此，自然就不能继承配置了。</p><p>不过，另一个功能在这种情况下倒是保留下来了：<strong>批量执行 maven 命令</strong> 。</p>',6),r={render:function(e,t){return n}}}}]);